import React from 'react';
import '../styles/Navbar.css';


const Navbar = () => (
    <nav>
        <h1>Intelligent Academic Advising System</h1>
        <ul>
            <li><a href="#">Dashboard</a></li>
            <li><a href="#">Profile</a></li>
            <li><a href="#">Logout</a></li>
        </ul>
    </nav>
);

export default Navbar;
